  PENALTYPARAM: 1
MORTAR COUPLING:
  ALGORITHM: "GPTS"
  NUMGP_PER_DIM: 3
  TRIANGULATION: "Center"
MORTAR COUPLING/PARALLEL REDISTRIBUTION:
